import { useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import ProductCard from "../Component/ProductCard"
import { getTodo } from "../redux/productReducer/action"


function Home() {

    const store = useSelector((data) => data.productReducer)
    const dispatch = useDispatch()

    console.log(store)

    useEffect(() => {
        dispatch(getTodo)
    }, [])

    return (
        <div>
            <h1>Products</h1>
            <div style={{display:"grid",gridTemplateColumns:"4 , 1fr"}}>
                {store.products.map((el) => {
                    return <ProductCard image={el.image} title={el.name} price={el.price} brand={el.brand} />
                })}
            </div>
        </div>

    )

}

export default Home
